    "summary": "Spinach, Tomato & Onion Couscous might be just the main course you are searching for. Watching your figure? This vegetarian recipe has <b>555 calories</b>, <b>19g of protein</b>, and <b>24g of fat</b> per serving. This recipe serves 3 and costs $3.16 per serving. If you have salt, olive oil, onion, and a few other ingredients on hand, you can make it. To use up the pine nuts you could follow this main course with the <a href=\"https://spoonacular.com/recipes/pear-cake-with-pine-nuts-167404\">Pear Cake with Pine Nuts</a> as a dessert. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. 8 people have tried and liked this recipe. All things considered, we decided this recipe <b>deserves a spoonacular score of 92%</b>. This score is spectacular. Try <a href=\"https://spoonacular.com/recipes/roasted-garlic-couscous-with-tomatoes-dill-onion-and-spinach-497176\">Roasted Garlic Couscous with Tomatoes, Dill, Onion, and Spinach</a>, <a href=\"https://spoonacular.com/recipes/lamb-chops-with-spinach-tomato-couscous-494031\">Lamb Chops with Spinach Tomato Couscous</a>, and <a href=\"https://spoonacular.com/recipes/feta-and-green-onion-couscous-cakes-over-tomato-olive-salad-133311\">Fetan and Green Onion Couscous Cakes over Tomato-Olive Salad</a> for similar recipes.",
