    "summary": "Chocolate Banoffee Pie might be just the dessert you are searching for. For <b>$2.14 per serving</b>, this recipe <b>covers 18%</b> of your daily requirements of vitamins and minerals. This recipe makes 8 servings with <b>858 calories</b>, <b>11g of protein</b>, and <b>50g of fat</b> each. A mixture of crackers, butter, thickened cream, and a handful of other ingredients are all it takes to make this recipe so delicious. 69 people have made this recipe and would make it again. From preparation to the plate, this recipe takes roughly <b>4 hours</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 56%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/chocolate-banoffee-puddings-555713\">Chocolate Banoffee Puddings</a>, <a href=\"https://spoonacular.com/recipes/chocolate-banoffee-puddings-555991\">Chocolate Banoffee Puddings</a>, and <a href=\"https://spoonacular.com/recipes/chocolate-banoffee-puddings-555911\">Chocolate Banoffee Puddings</a> for similar recipes.",
