    "occasions": [ ],
    "instructions": "<ol><li>Preheat oven to 180 degrees C</li><li>Process chocolate digestives and salted crackers in a food processor till crumbs</li><li>Mix the cookie/cracker crumbs with the browned butter and stir till combined and sticky (this is SO delicious, try not to eat it all!)</li><li>Get a 20cm diameter tart tin with a loose base and press the crumbly cookie mixture into it, filling out the shape. Make sure to press down the back of a spoon, and use damp hands to aid the process of putting it up the sides.</li><li>Chill for 20 minutes and then put to bake for 8-10 minutes. (Place it on top of a tray with baking paper since butter will leak a little)</li><li>Remove from the oven and let sit to room temperature.</li><li>Start making the toffee by placing melting the butter and brown sugar over medium-low heat till smooth.</li><li>Add in the sweetened condensed milk and bring to boiling point, before removing from heat. Make sure the mixture is thick and golden.</li><li>Add in the vanilla essence.</li><li>Let cool for 1/2 hour to 45 minutes, or till not hot to touch.</li><li>Lightly coat the bottom of the tart shell with a few spoonfuls of the toffee sauce,</li><li>Place a layer of bananas on top, making sure there are not banana pieces one on top of the other.</li><li>Pour a generous helping of the sauce on top, making sure to cover the bananas.</li><li>Depending on your tart shell's depth, add another layer of bananas on top, then another layer of sauce.</li><li>Place into the fridge to chill for 2-3 hours.</li><li>Meanwhile make the whipped cream by whipping the thickened cream with the vanilla essence and icing mixture till it holds its peak.</li><li>Meanwhile make the dark chocolate shards: Melt the chocolate in 20 second bursts in the microwave and pour onto a piece of baking paper. Spread using a flat spatula, leaving a thin coating of chocolate. Place in the fridge (if it is wonky, no worries) and remove from the fridge after an hour. Break into pieces to use.</li><li>Assemble the tart: Pipe little cornets all over the tart. Arrange pieces of chocolate shard on top artfully.</li></ol>",
