    "summary": "If you have approximately <b>roughly 45 minutes</b> to spend in the kitchen, Bacon Caramels might be a tremendous <b>gluten free</b> recipe to try. One portion of this dish contains about <b>1g of protein</b>, <b>5g of fat</b>, and a total of <b>72 calories</b>. For <b>12 cents per serving</b>, this recipe <b>covers 0%</b> of your daily requirements of vitamins and minerals. This recipe serves 80. It is brought to you by Foodista. 43 people were impressed by this recipe. It works well as a hor d'oeuvre. A mixture of bacon, vanilla, heavy cream, and a handful of other ingredients are all it takes to make this recipe so delicious. Taking all factors into account, this recipe <b>earns a spoonacular score of 1%</b>, which is improvable. Similar recipes are <a href=\"https://spoonacular.com/recipes/pumpkin-spice-caramels-and-common-mistakes-people-make-when-making-caramels-558668\">Pumpkin Spice Caramels (and common mistakes people make when making caramels)</a>, <a href=\"https://spoonacular.com/recipes/caramels-i-606336\">Caramels I</a>, and <a href=\"https://spoonacular.com/recipes/microwave-caramels-543880\">Microwave Caramels</a>.",
