    "summary": "The recipe Pan Seared Lamb Loin With Chimichurri & Roasted Trio Squash Salad With Goat Cheese and Pinenuts is ready <b>in approximately 45 minutes</b> and is definitely an amazing <b>caveman, gluten free, dairy free, and primal</b> option for lovers of South American food. One serving contains <b>492 calories</b>, <b>21g of protein</b>, and <b>43g of fat</b>. This recipe serves 4 and costs $3.83 per serving. It works well as a main course. 56 people have made this recipe and would make it again. If you have kosher salt and pepper, garlic clove, lamb loin chops, and a few other ingredients on hand, you can make it. To use up the lemon you could follow this main course with the <a href=\"https://spoonacular.com/recipes/lemon-shortbread-cookies-with-lemon-icing-a-tribute-to-aunt-roxanne-487814\">Lemon Shortbread Cookies with Lemon Icing {A Tribute to Aunt Roxanne}</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 86%</b>. This score is spectacular. Try <a href=\"https://spoonacular.com/recipes/roasted-carrot-and-butternut-squash-salad-with-mixed-greens-extra-sharp-cheddar-and-pinenuts-627239\">Roasted Carrot and Butternut Squash Salad with Mixed Greens, Extra Sharp Cheddar, and Pinenuts</a>, <a href=\"https://spoonacular.com/recipes/roasted-squash-prosciutto-and-goats-cheese-salad-658637\">Roasted Squash, Prosciutto and Goat's Cheese Salad</a>, and <a href=\"https://spoonacular.com/recipes/roasted-butternut-squash-salad-with-goats-cheese-578460\">Roasted butternut squash salad with goat’s cheese</a> for similar recipes.",
