    "summary": "Gluten Free Yellow Cake And Cupcakes is a <b>gluten free and lacto ovo vegetarian</b> recipe with 24 servings. One serving contains <b>270 calories</b>, <b>3g of protein</b>, and <b>18g of fat</b>. For <b>56 cents per serving</b>, this recipe <b>covers 2%</b> of your daily requirements of vitamins and minerals. 7 people found this recipe to be yummy and satisfying. Head to the store and pick up , eggs, earth balance butter, and a few other things to make it today. From preparation to the plate, this recipe takes roughly <b>roughly 45 minutes</b>. It is a <b>very budget friendly</b> recipe for fans of American food. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 4%</b>, which is very bad (but still fixable). If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/gluten-free-yellow-cupcakes-357200\">Gluten-Free Yellow Cupcakes</a>, <a href=\"https://spoonacular.com/recipes/gluten-free-yellow-cake-562660\">Gluten Free Yellow Cake</a>, and <a href=\"https://spoonacular.com/recipes/gluten-free-yellow-banana-cake-728994\">Gluten Free Yellow Banana Cake</a>.",
