    "summary": "Peppermint Brookie Pies - gluten free, dairy free might be just the dessert you are searching for. One serving contains <b>290 calories</b>, <b>3g of protein</b>, and <b>12g of fat</b>. This gluten free, dairy free, and fodmap friendly recipe serves 16 and costs <b>58 cents per serving</b>. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. If you have rice flour, eggs, ground espresso, and a few other ingredients on hand, you can make it. Only a few people made this recipe, and 6 would say it hit the spot. It can be enjoyed any time, but it is especially good for <b>Christmas</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 25%</b>. This score is rather bad. Similar recipes include <a href=\"https://spoonacular.com/recipes/thousand-island-dressing-gluten-free-corn-free-dairy-free-soy-free-nut-free-gum-free-and-refined-sugar-free-512186\">Thousand Island Dressing (Gluten-Free, Corn-Free, Dairy-Free, Soy-Free, Nut-Free, Gum-Free and Refined Sugar-Free)</a>, <a href=\"https://spoonacular.com/recipes/crock-pot-peppermint-fudge-gluten-free-dairy-free-556827\">Crock Pot Peppermint Fudge: [Gluten Free & Dairy Free]</a>, and <a href=\"https://spoonacular.com/recipes/gluten-free-vegan-walnut-and-oat-brownies-vegan-gluten-free-grain-free-flourless-dairy-free-no-refined-sugar-617963\">Gluten-Free Vegan Walnut and Oat Brownies (Vegan, Gluten-Free, Grain-Free, Flourless, Dairy-Free, No Refined Sugar)</a>.",
