    "summary": "You can never have too many American recipes, so give Nutella Stuffed French Toast a try. Watching your figure? This lacto ovo vegetarian recipe has <b>345 calories</b>, <b>9g of protein</b>, and <b>18g of fat</b> per serving. For <b>77 cents per serving</b>, you get a breakfast that serves 2. This recipe is liked by 15 foodies and cooks. Head to the store and pick up eggs, milk, cinnamon powder, and a few other things to make it today. From preparation to the plate, this recipe takes approximately <b>approximately 45 minutes</b>. It is brought to you by Foodista. Overall, this recipe earns a <b>not so super spoonacular score of 28%</b>. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/nutella-stuffed-french-toast-548464\">Nutella Stuffed French Toast</a>, <a href=\"https://spoonacular.com/recipes/nutella-stuffed-french-toast-446463\">nutella stuffed french toast</a>, and <a href=\"https://spoonacular.com/recipes/banana-and-nutella-stuffed-french-toast-515856\">Bananan and Nutella Stuffed French Toast</a>.",
