    "title": "Salsa Verde Chicken Tamales",
    "readyInMinutes": 45,
    "servings": 48,
    "sourceUrl": "https://www.foodista.com/recipe/68S5LMKB/salsa-verde-chicken-tamales",
    "image": "https://spoonacular.com/recipeImages/659180-556x370.jpg",
    "imageType": "jpg",
    "summary": "If you have around <b>approximately 45 minutes</b> to spend in the kitchen, Salsa Verde Chicken Tamales might be a great <b>dairy free</b> recipe to try. For <b>36 cents per serving</b>, this recipe <b>covers 6%</b> of your daily requirements of vitamins and minerals. One portion of this dish contains approximately <b>5g of protein</b>, <b>6g of fat</b>, and a total of <b>122 calories</b>. This recipe serves 48. A mixture of pablano chile, jalepeno chile, garlic, and a handful of other ingredients are all it takes to make this recipe so tasty. Not a lot of people really liked this Mexican dish. 8 people were glad they tried this recipe. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 21%</b>, which is rather bad. Try <a href=\"https://spoonacular.com/recipes/tamales-de-pollo-con-chile-verde-green-chile-chicken-tamales-107999\">Tamales De Pollo Con Chile Verde- Green Chile Chicken Tamales</a>, <a href=\"https://spoonacular.com/recipes/chicken-and-green-salsa-tamales-26415\">Chicken And Green Salsa Tamales</a>, and <a href=\"https://spoonacular.com/recipes/lightened-up-salsa-verde-chicken-enchiladas-with-pineapple-avocado-salsa-841861\">Lightened Up Salsa Verde Chicken Enchiladas with Pineapple Avocado Salsa</a> for similar recipes.",
