    "image": "https://spoonacular.com/recipeImages/663151-556x370.jpg",
    "imageType": "jpg",
    "summary": "The recipe Thai Shrimp is ready <b>in about 45 minutes</b> and is definitely an excellent <b>gluten free, dairy free, and pescatarian</b> option for lovers of Asian food. This recipe makes 4 servings with <b>368 calories</b>, <b>27g of protein</b>, and <b>8g of fat</b> each. For <b>$3.42 per serving</b>, this recipe <b>covers 23%</b> of your daily requirements of vitamins and minerals. It works well as a pretty expensive main course. 8 people have made this recipe and would make it again. A mixture of chilies, chicken stock, rice, and a handful of other ingredients are all it takes to make this recipe so yummy. To use up the peanut oil you could follow this main course with the <a href=\"https://spoonacular.com/recipes/salted-peanut-toffee-cookies-160785\">Salted Peanut Toffee Cookies</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 74%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/shrimp-pad-thai-for-two-375455\">Shrimp Pad Thai for Two</a>, <a href=\"https://spoonacular.com/recipes/shrimp-pad-thai-82676\">Shrimp Pad Thai</a>, and <a href=\"https://spoonacular.com/recipes/shrimp-pad-thai-375448\">Shrimp Pad Thai</a> for similar recipes.",
