    "imageType": "jpg",
    "summary": "The recipe French Toast Croissants with Strawberries could satisfy your American craving in around <b>20 minutes</b>. For <b>$2.74 per serving</b>, this recipe <b>covers 17%</b> of your daily requirements of vitamins and minerals. One serving contains <b>657 calories</b>, <b>9g of protein</b>, and <b>50g of fat</b>. A couple people made this recipe, and 11 would say it hit the spot. It works well as a morn meal. If you have butter, eggs, croissants, and a few other ingredients on hand, you can make it. All things considered, we decided this recipe <b>deserves a spoonacular score of 50%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/french-toast-with-strawberries-and-cream-339462\">French Toast with Strawberries and Cream</a>, <a href=\"https://spoonacular.com/recipes/lemon-french-toast-with-fresh-strawberries-513743\">Lemon French toast with fresh strawberries</a>, and <a href=\"https://spoonacular.com/recipes/strawberries-and-cream-stuffed-french-toast-475547\">Strawberries and Cream Stuffed French Toast</a> for similar recipes.",
