    "summary": "Chicken and White Bean Chili is an American recipe that serves 9. One portion of this dish contains about <b>23g of protein</b>, <b>30g of fat</b>, and a total of <b>417 calories</b>. For <b>$1.34 per serving</b>, this recipe <b>covers 15%</b> of your daily requirements of vitamins and minerals. 10 people were glad they tried this recipe. From preparation to the plate, this recipe takes approximately <b>approximately 45 minutes</b>. If you have onion, bell pepper, bay leaf, and a few other ingredients on hand, you can make it. It works well as a reasonably priced main course for <b>The Super Bowl</b>. It is brought to you by Foodista. All things considered, we decided this recipe <b>deserves a spoonacular score of 43%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/white-bean-chicken-chili-172968\">White Bean-Chicken Chili</a>, <a href=\"https://spoonacular.com/recipes/white-bean-and-chicken-chili-997716\">White Bean and Chicken Chili</a>, and <a href=\"https://spoonacular.com/recipes/white-bean-chicken-chili-520475\">White Bean Chicken Chili</a> for similar recipes.",
