    "summary": "All Day Simple Slow-Cooker FALL OFF the BONE Ribs is a <b>gluten free, dairy free, and fodmap friendly</b> recipe with 4 servings. One serving contains <b>598 calories</b>, <b>8g of protein</b>, and <b>11g of fat</b>. For <b>$1.47 per serving</b>, this recipe <b>covers 11%</b> of your daily requirements of vitamins and minerals. Head to the store and pick up slabs of pork ribs, broth, salt, and a few other things to make it today. 61 person were glad they tried this recipe. It will be a hit at your <b>Autumn</b> event. From preparation to the plate, this recipe takes roughly <b>roughly 45 minutes</b>. It is brought to you by Foodista. With a spoonacular <b>score of 35%</b>, this dish is rather bad. Similar recipes include <a href=\"https://spoonacular.com/recipes/fall-off-the-bone-slow-cooker-ribs-603823\">Fall-Off-The-Bone Slow Cooker Ribs</a>, <a href=\"https://spoonacular.com/recipes/slow-cooker-fall-off-the-bone-pork-ribs-944004\">Slow Cooker Fall Off the Bone Pork Ribs</a>, and <a href=\"https://spoonacular.com/recipes/fall-off-the-bone-ribs-143363\">Fall off the Bone Ribs</a>.",
