    "summary": "S'mores-n-berry Bars for National S'mores Day - August 10 might be just the side dish you are searching for. For <b>$1.35 per serving</b>, this recipe <b>covers 6%</b> of your daily requirements of vitamins and minerals. This recipe makes 9 servings with <b>507 calories</b>, <b>5g of protein</b>, and <b>25g of fat</b> each. From preparation to the plate, this recipe takes around <b>45 minutes</b>. A mixture of brownie mix, sugar, vegetable oil, and a handful of other ingredients are all it takes to make this recipe so delicious. This recipe is liked by 12 foodies and cooks. All things considered, we decided this recipe <b>deserves a spoonacular score of 21%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/roasted-berry-smores-503606\">roasted Berry S’mores</a>, <a href=\"https://spoonacular.com/recipes/smores-bars-606366\">S’mores Bars</a>, and <a href=\"https://spoonacular.com/recipes/smores-bars-467974\">S'mores Bars</a> for similar recipes.",
