    "occasions": [ ],
    "instructions": "<ol><li>Preheat your oven to 325 degrees F.</li><li>Line an 8-inch-square baking pan with foil so that it hangs over the edges and spray it with nonstick cooking spray.</li><li>Use a medium-sized bowl to mix together the melted butter, graham cracker crumbs and sugar.</li><li>Press the crumb mixture evenly on the bottom of the pan.</li><li>Bake until golden, or for about 20 minutes. Remove and set aside.</li><li>Raise the oven temperature to 350 degrees F.</li><li>Meanwhile, use a medium-sized bowl and mix the brownie mixture together, then gently fold in the raspberries.</li><li>Pour the batter over the graham cracker crust.</li><li>Bake the brownie mixture for about 25 minutes (based on your brownie mix), or until a toothpick inserted in the middle of the brownie comes out clean.</li><li>Remove the brownie and place the oven on broil.</li><li>Meanwhile, break the two graham crackers into small pieces and arrange them in a single layer on top of the brownie.</li><li>Next arrange the mini marshmallows evenly over the top of the graham crackers.</li><li>Place the pan back in the oven, just for a few minutes, until the marshmallows begin to brown. Keep a close watch on them so they dont burn under the broiler.</li><li>Remove from the oven and cool completely.</li><li>Remove from the pan using the overhanging foil and cut into bars to serve.</li></ol>",
