    "summary": "Lemon Scented Polenta Pancakes with Blueberry Thyme Syrup might be just the morn meal you are searching for. This recipe makes 12 servings with <b>316 calories</b>, <b>3g of protein</b>, and <b>17g of fat</b> each. For <b>$1.24 per serving</b>, this recipe <b>covers 8%</b> of your daily requirements of vitamins and minerals. This recipe from Foodista has 79 fans. A mixture of egg, water, butter, and a handful of other ingredients are all it takes to make this recipe so delicious. From preparation to the plate, this recipe takes around <b>45 minutes</b>. It is a good option if you're following a <b>vegetarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 34%</b>. This score is not so awesome. Similar recipes include <a href=\"https://spoonacular.com/recipes/lemon-cream-cheese-pancakes-with-blueberry-maple-syrup-51528\">Lemon Cream Cheese Pancakes With Blueberry Maple Syrup</a>, <a href=\"https://spoonacular.com/recipes/blueberry-lemon-ricotta-pancakes-with-blackberry-vanilla-syrup-582792\">Blueberry Lemon Ricotta Pancakes with Blackberry Vanilla Syrup</a>, and <a href=\"https://spoonacular.com/recipes/pumpkin-ricotta-pancakes-with-ginger-thyme-syrup-522002\">Pumpkin Ricotta Pancakes with Ginger-Thyme Syrup</a>.",
