    "summary": "Need a <b>gluten free and primal main course</b>? Pesto Chicken Zoodles could be an amazing recipe to try. For <b>$2.5 per serving</b>, this recipe <b>covers 26%</b> of your daily requirements of vitamins and minerals. One serving contains <b>524 calories</b>, <b>35g of protein</b>, and <b>41g of fat</b>. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. 22 people have made this recipe and would make it again. Head to the store and pick up cajun seasoning, chicken breasts seasoned, olive oil, and a few other things to make it today. To use up the olive oil you could follow this main course with the <a href=\"https://spoonacular.com/recipes/sauteed-banana-granola-and-yogurt-parfait-624619\">Sauteed Banana, Granolan and Yogurt Parfait</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 76%</b>. This score is solid. Similar recipes include <a href=\"https://spoonacular.com/recipes/pesto-zoodles-with-chicken-757213\">Pesto Zoodles with Chicken</a>, <a href=\"https://spoonacular.com/recipes/shrimp-and-pesto-zoodles-874131\">Shrimp and Pesto Zoodles</a>, and <a href=\"https://spoonacular.com/recipes/low-fat-vegan-pesto-zoodles-with-broccoli-720890\">Low Fat Vegan Pesto Zoodles with Broccoli</a>.",
