    "summary": "If you want to add more <b>gluten free</b> recipes to your recipe box, Rocky Road Ice Cream might be a recipe you should try. One portion of this dish contains about <b>29g of protein</b>, <b>65g of fat</b>, and a total of <b>860 calories</b>. For <b>$2.65 per serving</b>, this recipe <b>covers 39%</b> of your daily requirements of vitamins and minerals. This recipe serves 10. 23 people have made this recipe and would make it again. It will be a hit at your <b>Summer</b> event. A mixture of almonds, condensed milk, vanillan extract, and a handful of other ingredients are all it takes to make this recipe so flavorful. From preparation to the plate, this recipe takes roughly <b>roughly 45 minutes</b>. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 90%</b>, which is great. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/rocky-road-ice-cream-35567\">Rocky Road Ice Cream</a>, <a href=\"https://spoonacular.com/recipes/rocky-road-ice-cream-205620\">Rocky Road Ice Cream</a>, and <a href=\"https://spoonacular.com/recipes/rocky-road-ice-cream-433529\">Rocky Road Ice Cream</a>.",
