    "id": 645714,
    "title": "Grilled Fish With Sun Dried Tomato Relish",
    "readyInMinutes": 45,
    "servings": 2,
    "sourceUrl": "http://www.foodista.com/recipe/MNHCWRZH/grilled-fish-with-sun-dried-tomato-relish",
    "image": "https://spoonacular.com/recipeImages/645714-556x370.jpg",
    "imageType": "jpg",
    "summary": "You can never have too many main course recipes, so give Grilled Fish With Sun Dried Tomato Relish a try. One serving contains <b>703 calories</b>, <b>42g of protein</b>, and <b>25g of fat</b>. This gluten free, dairy free, fodmap friendly, and pescatarian recipe serves 2 and costs <b>$7.34 per serving</b>. 16 people have tried and liked this recipe. It can be enjoyed any time, but it is especially good for <b>The Fourth Of July</b>. If you have pepper, extra virgin olive oil, salt, and a few other ingredients on hand, you can make it. To use up the salt you could follow this main course with the <a href=\"https://spoonacular.com/recipes/apple-turnovers-recipe-48175\">Apple Turnovers Recipe</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 93%</b>. This score is amazing. Try <a href=\"https://spoonacular.com/recipes/artichoke-and-sun-dried-tomato-pasta-926592\">Artichoke and Sun Dried Tomato Pasta</a>, <a href=\"https://spoonacular.com/recipes/grilled-tuna-with-sun-dried-tomato-relish-8067\">Grilled Tuna With Sun-dried Tomato Relish</a>, and <a href=\"https://spoonacular.com/recipes/sun-dried-tomato-pesto-pasta-with-zoodles-914788\">Sun Dried Tomato Pesto Pasta with Zoodles</a> for similar recipes.",
