    "summary": "Layered Poppy Seed Pastries might be just the hor d'oeuvre you are searching for. For <b>30 cents per serving</b>, this recipe <b>covers 5%</b> of your daily requirements of vitamins and minerals. One serving contains <b>201 calories</b>, <b>3g of protein</b>, and <b>10g of fat</b>. A few people made this recipe, and 17 would say it hit the spot. A mixture of sugar, poppy seed filling, whl egg plus, and a handful of other ingredients are all it takes to make this recipe so flavorful. It is a good option if you're following a <b>vegetarian</b> diet. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 25%</b>. This score is not so excellent. Try <a href=\"https://spoonacular.com/recipes/chewy-almond-poppy-seed-granola-bars-lemon-poppy-seed-variation-too-543986\">Chewy Almond Poppy Seed Granola Bars (Lemon Poppy Seed variation too)</a>, <a href=\"https://spoonacular.com/recipes/winning-mini-coconut-cupcakes-with-poppy-seed-crust-muscat-raisin-filling-and-parsley-icing-with-toasted-coconut-flax-and-poppy-seed-toffee-and-organic-roses-330913\">Winning Mini Coconut Cupcakes with Poppy Seed Crust, Muscat Raisin Filling, and Parsley Icing with Toasted Coconut, Flax and Poppy Seed Toffee, and Organic Roses</a>, and <a href=\"https://spoonacular.com/recipes/poppy-and-grandmas-layered-rakott-crumpli-from-joy-of-kosher-471265\">Poppy and Grandma's Layered Rakott Crumpli From 'Joy of Kosher</a> for similar recipes.",
