    "summary": "French Onion Marsala Soup is a main course that serves 4. One portion of this dish contains roughly <b>26g of protein</b>, <b>40g of fat</b>, and a total of <b>596 calories</b>. For <b>$2.72 per serving</b>, this recipe <b>covers 18%</b> of your daily requirements of vitamins and minerals. A mixture of provolone cheese, parmesan cheese, onions, and a handful of other ingredients are all it takes to make this recipe so tasty. It is a <b>rather cheap</b> recipe for fans of Mediterranean food. From preparation to the plate, this recipe takes roughly <b>roughly 45 minutes</b>. This recipe from Foodista has 8 fans. It will be a hit at your <b>Autumn</b> event. With a spoonacular <b>score of 40%</b>, this dish is rather bad. <a href=\"https://spoonacular.com/recipes/le-cafe-ile-st-louis-onion-soup-gratinee-this-is-a-new-take-on-the-classic-french-onion-soup-599269\">Le Cafe Ile St. Louis Onion Soup Gratinee – this is a new take on the classic French Onion Soup</a>, <a href=\"https://spoonacular.com/recipes/french-onion-soup-topped-french-bread-pizzas-and-salad-with-dijon-vinaigrette-312082\">French Onion Soup Topped French Bread Pizzas and Salad with Dijon Vinaigrette</a>, and <a href=\"https://spoonacular.com/recipes/crockpot-french-onion-soup-with-cheesy-french-toast-685740\">Crockpot French Onion Soup with Cheesy French Toast</a> are very similar to this recipe.",
