    "summary": "Snap Pean and Green Bean Salad with Arugula Pesto might be just the side dish you are searching for. For <b>$2.27 per serving</b>, this recipe <b>covers 23%</b> of your daily requirements of vitamins and minerals. One serving contains <b>441 calories</b>, <b>12g of protein</b>, and <b>36g of fat</b>. Head to the store and pick up roasted almonds, wax beans, lemon zest, and a few other things to make it today. Several people made this recipe, and 127 would say it hit the spot. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. It is a good option if you're following a <b>gluten free, primal, and vegetarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 96%</b>. This score is spectacular. Try <a href=\"https://spoonacular.com/recipes/snap-peas-and-green-beans-with-arugula-mint-pesto-716442\">Snap Peas and Green Beans with Arugula-Mint Pesto</a>, <a href=\"https://spoonacular.com/recipes/snap-peas-and-green-beans-with-arugula-mint-pesto-875123\">Snap Peas and Green Beans with Arugula-Mint Pesto</a>, and <a href=\"https://spoonacular.com/recipes/michael-natkins-potato-and-green-bean-salad-with-arugula-pesto-205312\">Michael Natkin's Potato and Green Bean Salad with Arugula Pesto</a> for similar recipes.",
