    "summary": "Blueberry Almond Crescent Rolls might be just the bread you are searching for. This recipe serves 8 and costs 79 cents per serving. One serving contains <b>247 calories</b>, <b>3g of protein</b>, and <b>12g of fat</b>. This recipe is liked by 122 foodies and cooks. Head to the store and pick up almond extract, regular crescent rolls, flour, and a few other things to make it today. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 11%</b>. This score is rather bad. Similar recipes include <a href=\"https://spoonacular.com/recipes/blueberry-cream-cheese-crescent-rolls-giveaway-532812\">Blueberry Cream Cheese Crescent Rolls & Giveaway</a>, <a href=\"https://spoonacular.com/recipes/pillsbury-refrigerated-crescent-dinner-rolls-or-pillsbury-crescent-creations-refrigerated-flaky-dough-sheet-549847\">Pillsbury® refrigerated crescent dinner rolls or Pillsbury® Crescent Creations™ refrigerated flaky dough sheet</a>, and <a href=\"https://spoonacular.com/recipes/crescent-rolls-489337\">Crescent Rolls</a>.",
