    "summary": "This gluten free and vegetarian recipe serves 4 and costs <b>$1.77 per serving</b>. One serving contains <b>536 calories</b>, <b>12g of protein</b>, and <b>38g of fat</b>. It will be a hit at your <b>Summer</b> event. Head to the store and pick up guava, peanuts, condensed milk, and a few other things to make it today. 19 people have made this recipe and would make it again. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 59%</b>. This score is good. Similar recipes include <a href=\"https://spoonacular.com/recipes/toasted-coconut-cold-brew-banana-ice-cream-910378\">Toasted Coconut Cold Brew Bananan Ice Cream</a>, <a href=\"https://spoonacular.com/recipes/guava-coconut-rum-cocktail-391830\">Guava Coconut Rum Cocktail</a>, and <a href=\"https://spoonacular.com/recipes/coconut-guava-martini-554981\">Coconut Guava Martini</a>.",
