    "summary": "Peppermint Hot Chocolate Cupcakes might be just the <b>American</b> recipe you are searching for. One serving contains <b>375 calories</b>, <b>3g of protein</b>, and <b>15g of fat</b>. For <b>56 cents per serving</b>, this recipe <b>covers 5%</b> of your daily requirements of vitamins and minerals. It can be enjoyed any time, but it is especially good for <b>Christmas</b>. A couple people made this recipe, and 42 would say it hit the spot. From preparation to the plate, this recipe takes around <b>45 minutes</b>. A mixture of vanillan extract, vegetable oil, hot-brewed coffee, and a handful of other ingredients are all it takes to make this recipe so scrumptious. All things considered, we decided this recipe <b>deserves a spoonacular score of 22%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/chocolate-peppermint-cupcakes-592618\">Chocolate Peppermint Cupcakes</a>, <a href=\"https://spoonacular.com/recipes/chocolate-peppermint-cupcakes-687222\">Chocolate Peppermint Cupcakes</a>, and <a href=\"https://spoonacular.com/recipes/chocolate-peppermint-cupcakes-834865\">Chocolate Peppermint Cupcakes</a> for similar recipes.",
