    "summary": "You can never have too many main course recipes, so give BBQ Beef Brisket a try. This gluten free and dairy free recipe serves 8 and costs <b>$3.07 per serving</b>. One portion of this dish contains approximately <b>48g of protein</b>, <b>21g of fat</b>, and a total of <b>514 calories</b>. This recipe is typical of Jewish cuisine. This recipe is liked by 19 foodies and cooks. <b>Hanukkah</b> will be even more special with this recipe. This recipe from Foodista requires brown sugar, salt and pepper, garlic powder, and cornstarch. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. Overall, this recipe earns a <b>solid spoonacular score of 68%</b>. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/bbq-beef-brisket-186497\">BBQ Beef Brisket</a>, <a href=\"https://spoonacular.com/recipes/bbq-beef-brisket-128731\">BBQ Beef Brisket</a>, and <a href=\"https://spoonacular.com/recipes/bbq-beef-brisket-597496\">BBQ Beef Brisket</a>.",
