    "summary": "Lemon Coconut Granola might be just the morn meal you are searching for. Watching your figure? This gluten free, dairy free, and vegetarian recipe has <b>263 calories</b>, <b>6g of protein</b>, and <b>16g of fat</b> per serving. For <b>56 cents per serving</b>, this recipe <b>covers 9%</b> of your daily requirements of vitamins and minerals. 32 people have made this recipe and would make it again. If you have rolled oats, honey, currants, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 63%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/lemon-coconut-granola-bites-516534\">Lemon Coconut Granola Bites</a>, <a href=\"https://spoonacular.com/recipes/full-house-coconut-cupcakes-lemon-curd-filling-coconut-lemon-buttercream-frosting-toasted-coconut-294081\">Full House: Coconut Cupcakes, Lemon Curd Filling, Coconut-Lemon Buttercream Frosting, Toasted Coconut</a>, and <a href=\"https://spoonacular.com/recipes/roasted-blueberry-coconut-quinoa-parfaits-with-coconut-granola-525222\">Roasted Blueberry Coconut Quinoa Parfaits with Coconut Granola</a> for similar recipes.",
