    "instructions": "<ol><li>Preheat oven to 150C.</li><li>In a pan, combine coconut oil, honey, lemon peel and lemon juice. Bring to boil. Take off the heat when the honey is dissolved. Let cool a little.</li><li>In another bowl, combine oats, flax seeds and chopped nuts. Mix well. Pour the honey mixture over the dry ingredients and stir until the oat mixture is well coated.</li><li>Spread the granola evenly on a baking pan, and bake for 20 minutes. Turn over the granola, and stir in the coconut flakes. Bake for another 10 minutes. Let cool and stir in the currants. Keep in airtight container.</li></ol>",
