    "summary": "If you have approximately <b>approximately 45 minutes</b> to spend in the kitchen, Monastery soup might be an awesome <b>gluten free, dairy free, lacto ovo vegetarian, and vegan</b> recipe to try. For <b>$1.57 per serving</b>, you get a soup that serves 4. One serving contains <b>258 calories</b>, <b>8g of protein</b>, and <b>8g of fat</b>. It can be enjoyed any time, but it is especially good for <b>Autumn</b>. It is brought to you by Foodista. A mixture of potatoes, leek, salt and pepper, and a handful of other ingredients are all it takes to make this recipe so tasty. This recipe is liked by 7 foodies and cooks. Overall, this recipe earns an <b>excellent spoonacular score of 89%</b>. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/jamaican-soup-beef-and-pumpkin-flavor-this-soup-be-adventurous-and-try-soup-from-the-carribean-600076\">Jamaican soup – beef and pumpkin flavor this soup. Be adventurous and try soup from the carribean</a>, <a href=\"https://spoonacular.com/recipes/a-quick-and-easy-soup-miso-soup-with-soba-noodles-or-mung-bean-31003\">A Quick And Easy Soup {miso Soup With Soba Noodles Or Mung Bean</a>, and <a href=\"https://spoonacular.com/recipes/puerto-rican-chuletn-soup-aka-xmas-ham-bone-soup-574360\">Puerto Rican Chuletón Soup AKA Xmas Ham Bone Soup</a>.",
