    "summary": "You can never have too many main course recipes, so give Chicken Sausage, White Bean and Cabbage Soup a try. This gluten free and dairy free recipe serves 6 and costs <b>$1.96 per serving</b>. One portion of this dish contains approximately <b>19g of protein</b>, <b>13g of fat</b>, and a total of <b>312 calories</b>. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. 13 people have tried and liked this recipe. Head to the store and pick up mild chicken sausage, onion, vegetable stock, and a few other things to make it today. It is brought to you by Foodista. It is perfect for <b>Autumn</b>. Overall, this recipe earns a <b>solid spoonacular score of 66%</b>. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/white-bean-and-chicken-sausage-soup-1065782\">White Bean and Chicken Sausage Soup</a>, <a href=\"https://spoonacular.com/recipes/chicken-sausage-and-white-bean-soup-video-850572\">Chicken Sausage and White Bean Soup Video</a>, and <a href=\"https://spoonacular.com/recipes/cabbage-and-white-bean-soup-11799\">Cabbage and White Bean Soup</a>.",
