    "summary": "The recipe Mexican Casserole could satisfy your Mexican craving in around <b>1 hour and 5 minutes</b>. This recipe serves 6 and costs $1.97 per serving. This main course has <b>494 calories</b>, <b>33g of protein</b>, and <b>19g of fat</b> per serving. It can be enjoyed any time, but it is especially good for <b>Autumn</b>. 503 people have made this recipe and would make it again. Head to the store and pick up salsa, monterrey jack, cream of chicken soup, and a few other things to make it today. To use up the salsa you could follow this main course with the <a href=\"https://spoonacular.com/recipes/dessert-strawberry-salsa-553911\">Dessert Strawberry Salsa</a> as a dessert. It is a good option if you're following a <b>gluten free</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 79%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/mexican-cornbread-casserole-make-a-mexican-casserole-dinner-that-is-easy-to-make-and-reheats-well-600366\">Mexican Cornbread Casserole – make a Mexican casserole dinner that is easy to make, and reheats well</a>, <a href=\"https://spoonacular.com/recipes/mexican-casserole-162857\">Mexican Casserole</a>, and <a href=\"https://spoonacular.com/recipes/mexican-casserole-513196\">Mexican Casserole</a> for similar recipes.",
