    "summary": "Rigatoni With Sweet Sausages In Creamy Tomato Sauce might be just the main course you are searching for. This recipe makes 4 servings with <b>930 calories</b>, <b>33g of protein</b>, and <b>40g of fat</b> each. For <b>$1.9 per serving</b>, this recipe <b>covers 36%</b> of your daily requirements of vitamins and minerals. This recipe is liked by 82 foodies and cooks. If you have cayenne pepper, garlic cloves, sugar, and a few other ingredients on hand, you can make it. It is brought to you by Foodista. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. Overall, this recipe earns a <b>great spoonacular score of 91%</b>. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/rigatoni-in-creamy-tomato-sauce-207166\">Rigatoni in Creamy Tomato Sauce</a>, <a href=\"https://spoonacular.com/recipes/one-pan-rigatoni-with-creamy-red-wine-tomato-sauce-821935\">One Pan Rigatoni with Creamy Red Wine Tomato Sauce</a>, and <a href=\"https://spoonacular.com/recipes/creamy-pesto-rigatoni-with-chunky-tomato-vinaigrette-198535\">Creamy Pesto Rigatoni with Chunky Tomato Vinaigrette</a>.",
